import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Route, Switch,IndexRoute} from 'react-router-dom'
// import { browserHistory, HashRouter, Router, Route, IndexRoute, Switch } from 'react-router'

import LqDetail from './lq-detail';
import SearchTool from './search-tool';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      {/* <Switch> */}
        
          {/* <IndexRoute component={SearchTool}/> */}
          {/* <Route path='lq-detail' component={LqDetail} /> */}
      {/* </Switch> */}
      <Switch>
      <Route path='/' component={App} />
        <Route path='/lq-detail'>
          <LqDetail />
        </Route>
      </Switch>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
